import React from "react";
const Users=(props)=>{
    const listItemStyle = {
        display: "flex",
        alignItems: "center",
      };
    
      const buttonStyle = {
        marginRight: "10px",
      };
     
      
      return (
        <>
          <div style={listItemStyle}>
            <button className="dltBtn" style={buttonStyle} ></button>
            <li>{props.text}</li>
          </div>
        </>
      );
    };
    
export default Users;
